import Card from '../UI/Card';
import MealItem from './MealItem/MealItem';
import classes from './AvailableMeals.module.css';

const DUMMY_MEALS = [
    {
      id: 'm1',
      name: 'MANGO MATCHA LATTE',
      description: 'Our organic premium-grade matcha from Tea People layered over your choice of milk and housemade mango purée.',
      price: 22.99,
    },
    {
      id: 'm2',
      name: 'Black Sesame Milk Tea',
      description: 'A filipino specialty!',
      price: 16.5,
    },
    {
      id: 'm3',
      name: 'Passion Fruit Green Tea',
      description: 'mhm refreshing',
      price: 12.99,
    },
    {
      id: 'm4',
      name: 'Jasmine Green Tea',
      description: 'Bubbies signature',
      price: 18.99,
    },
  ];

const AvailableMeals = () => {
    const mealsList = DUMMY_MEALS.map((meal) => (
    <MealItem 
      key = {meal.id}
      id = {meal.id}
      name = {meal.name} 
      description = {meal.description} 
      price = {meal.price}
      />
      ));

    return (
    <section className = {classes.meals}>
            <Card>
            <ul>{mealsList}</ul>
            </Card>
    </section>
    );
};

export default AvailableMeals;
